int GTOmax_shell_dim(const int *ao_loc, const int *shls_slice, int ncenter) {

        int i;
        int i0 = shls_slice[0];
        int i1 = shls_slice[1];
        int di = 0;
        for (i = 1; i < ncenter; i++) {
                i0 = MIN(i0, shls_slice[i*2  ]);
                i1 = MAX(i1, shls_slice[i*2+1]);
        }
        for (i = i0; i < i1; i++) {
                di = MAX(di, ao_loc[i+1]-ao_loc[i]);
        }
        return di;
}
int GTOmax_cache_size(int *shls_slice, int ncenter,
                      int *atm, int natm, int *bas, int nbas, dtype *env, int n_env) {
        int i, n;
        int i0 = shls_slice[0];
        int i1 = shls_slice[1];
        for (i = 1; i < ncenter; i++) {
                i0 = MIN(i0, shls_slice[i*2  ]);
                i1 = MAX(i1, shls_slice[i*2+1]);
        }
        int shls[4];
        int cache_size = 0;
        for (i = i0; i < i1; i++) {
                shls[0] = i;
                shls[1] = i;
                shls[2] = i;
                shls[3] = i;

                n = int2e_sph(NULL, 0, NULL, shls, atm, natm, bas, nbas, env, n_env);
                cache_size = MAX(cache_size, n);
        }
        return cache_size;
}

