        int dj = ao_loc[jsh+1] - ao_loc[jsh];
        int dij = di * dj;
        int k0, l0, dk, dl, dijk, dijkl;
        int i, j, k, l, icomp;
        int ksh, lsh;
        int shls[4];
        input_type *eri0, *peri; //*buf0, *pbuf, *cache;
        dtype *buf0, *pbuf;//, *cache;

        shls[0] = ish;
        shls[1] = jsh;

        int max = -1;
