                                        g[n]            = _rx * g[n-dj]          + g[n-dj+di];
                                        g[n+g_size]     = _ry * g[n+g_size-dj]   + g[n-dj+di+g_size];
                                        g[n+g_size*2]   = _rz * g[n+g_size*2-dj] + g[n-dj+di+g_size*2];
