/*
 * a[m,n] -> a_t[n,m]
 */
void CINTdmat_transpose(dtype *a_t, dtype *a, int m, int n)
{
        int i, j, k;

        for (j = 0; j < n-3; j+=4) {
#pragma GCC ivdep
                for (i = 0; i < m; i++) {
                        a_t[(j+0)*m+i] = a[i*n+j+0];
                        a_t[(j+1)*m+i] = a[i*n+j+1];
                        a_t[(j+2)*m+i] = a[i*n+j+2];
                        a_t[(j+3)*m+i] = a[i*n+j+3];
                }
        }

        switch (n-j) {
        case 1:
#pragma GCC ivdep
                for (i = 0; i < m; i++) {
                        a_t[j*m+i] = a[i*n+j];
                }
                break;
        case 2:
#pragma GCC ivdep
                for (i = 0; i < m; i++) {
                        a_t[(j+0)*m+i] = a[i*n+j+0];
                        a_t[(j+1)*m+i] = a[i*n+j+1];
                }
                break;
        case 3:
#pragma GCC ivdep
                for (i = 0; i < m; i++) {
                        a_t[(j+0)*m+i] = a[i*n+j+0];
                        a_t[(j+1)*m+i] = a[i*n+j+1];
                        a_t[(j+2)*m+i] = a[i*n+j+2];
                }
                break;
        }
}

/*
 * a_t[n,m] += a[m,n]
 */
void CINTdplus_transpose(dtype *a_t, dtype *a, int m, int n)
{
        int i, j, k;

        for (j = 0; j < n-3; j+=4) {
#pragma GCC ivdep
                for (i = 0; i < m; i++) {
                        a_t[(j+0)*m+i] += a[i*n+j+0];
                        a_t[(j+1)*m+i] += a[i*n+j+1];
                        a_t[(j+2)*m+i] += a[i*n+j+2];
                        a_t[(j+3)*m+i] += a[i*n+j+3];
                }
        }

        switch (n-j) {
        case 1:
#pragma GCC ivdep
                for (i = 0; i < m; i++) {
                        a_t[j*m+i] += a[i*n+j];
                }
                break;
        case 2:
#pragma GCC ivdep
                for (i = 0; i < m; i++) {
                        a_t[(j+0)*m+i] += a[i*n+j+0];
                        a_t[(j+1)*m+i] += a[i*n+j+1];
                }
                break;
        case 3:
#pragma GCC ivdep
                for (i = 0; i < m; i++) {
                        a_t[(j+0)*m+i] += a[i*n+j+0];
                        a_t[(j+1)*m+i] += a[i*n+j+1];
                        a_t[(j+2)*m+i] += a[i*n+j+2];
                }
                break;
        }
}


void CINTdgemm_NN1(int m, int n, int k,
                   dtype *a, dtype *b, dtype *c, int ldc) {
        int i, j, kp;
        dtype bi;
        for (j = 0; j < n; j++) {
                for (i = 0; i < m; i++) {
                        c[i+ldc*j] = 0;
                }
                for (kp = 0; kp < k; kp++) {
                        bi = b[kp+k*j];
#pragma GCC ivdep
                        for (i = 0; i < m; i++) {
                                c[i+ldc*j] += a[i+m*kp] * bi;
                        }
                }
        }
}

// this does a matmul with the big matrix hardcoded in here! 
void CINTdgemm_NN(int m, int n, int k, dtype *a, dtype *b, dtype *c) {
        CINTdgemm_NN1(m, n, k, a, b, c, m);
}

void CINTdgemm_TN(int m, int n, int k,
                  dtype *a, dtype *b, dtype *c)
{
        int i, j, kp;
        dtype ci;
        for (j = 0; j < n; j++) {
                for (i = 0; i < m; i++) {
                        ci = 0;
#pragma GCC ivdep
                        for (kp = 0; kp < k; kp++) {
                                //printf("%i ", kp+k*i);
                                ci += a[kp+k*i] * b[kp+k*j];
                        }
                        c[i+m*j] = ci;
                }
        }
        //printf("\n");
        fflush(stdout);
}

