// converts from ddtype to dtype 
CACHE_SIZE_T _int2e_sph(ddtype *out, int n_out, int *dims, int *shls, int *atm, int natm, int *bas, int nbas, ddtype *env, int n_env) {
        dtype _out[n_out];
        for (int i = 0; i < n_out; i++) _out[i] = out[i];
        dtype * __out = _out;


        dtype _env[n_env];
        for (int i = 0; i < n_env; i++) _env[i] = env[i];
        dtype * __env = _env;

        CACHE_SIZE_T ret = int2e_sph(__out, n_out, dims, shls, atm, natm, bas, nbas, __env, n_env);

        // move back 
        for (int i = 0; i < n_out; i++) out[i] = __out[i];
        for (int i = 0; i < n_env; i++) env[i] = __env[i];

        return ret; 
}


// only *out/*buf left. 
CACHE_SIZE_T int2e_sph(dtype *out, int n_out, int *dims, int *shls, int *atm, int natm, int *bas, int nbas, dtype *env, int n_env) {
        
        int ng[] = {0, 0, 0, 0, 0, 1, 1, 1};

        const int i_sh = shls[0];
        const int j_sh = shls[1];
        const int k_sh = shls[2];
        const int l_sh = shls[3];
        //printf("[%i %i %i %i]", i_sh, j_sh, k_sh, l_sh);
        int i_l = bas[BAS_SLOTS * i_sh + ANG_OF];
        int j_l = bas[BAS_SLOTS * j_sh + ANG_OF];
        int k_l = bas[BAS_SLOTS * k_sh + ANG_OF];
        int l_l = bas[BAS_SLOTS * l_sh + ANG_OF];
                        
        int _x_ctr[4];
        _x_ctr[0] = bas[BAS_SLOTS * i_sh + NCTR_OF];
        _x_ctr[1] = bas[BAS_SLOTS * j_sh + NCTR_OF];
        _x_ctr[2] = bas[BAS_SLOTS * k_sh + NCTR_OF];
        _x_ctr[3] = bas[BAS_SLOTS * l_sh + NCTR_OF];


        int nfi  = (i_l+1)*(i_l+2)/2;
        int nfj  = (j_l+1)*(j_l+2)/2;
        int nfk  = (k_l+1)*(k_l+2)/2;
        int nfl  = (l_l+1)*(l_l+2)/2;
        size_t nf = nfi * nfk * nfl * nfj;
        int gbits        = ng[GSHIFT];
        int ncomp_e1     = ng[POS_E1];
        int ncomp_e2     = ng[POS_E2];
        int ncomp_tensor = ng[TENSOR];
        dtype gctr[nf * _x_ctr[0] * _x_ctr[1] * _x_ctr[2] * _x_ctr[3] * ncomp_e1 * ncomp_e2 * ncomp_tensor];
        int _v = nf * _x_ctr[0] * _x_ctr[1] * _x_ctr[2] * _x_ctr[3] * ncomp_e1 * ncomp_e2 * ncomp_tensor;
        //if (_v > 350) printf("[gctr=%i]", _v);

        //printf("\n\n@@%li\n\n", nf * _x_ctr[0] * _x_ctr[1] * _x_ctr[2] * _x_ctr[3] * ncomp_e1 * ncomp_e2 * ncomp_tensor);


        // #define atm(SLOT,I)     atm[ATM_SLOTS * (I) + (SLOT)]
        dtype * ri = env + atm[ATM_SLOTS * bas[BAS_SLOTS*i_sh + ATOM_OF] + PTR_COORD];
        dtype * rj = env + atm[ATM_SLOTS * bas[BAS_SLOTS*j_sh + ATOM_OF] + PTR_COORD];
        dtype * rk = env + atm[ATM_SLOTS * bas[BAS_SLOTS*k_sh + ATOM_OF] + PTR_COORD];
        dtype * rl = env + atm[ATM_SLOTS * bas[BAS_SLOTS*l_sh + ATOM_OF] + PTR_COORD];

        dtype expcutoff;

        dtype common_factor = (M_PI*M_PI*M_PI)*2/SQRTPI * CINTcommon_fac_sp(i_l) * CINTcommon_fac_sp(j_l) * CINTcommon_fac_sp(k_l) * CINTcommon_fac_sp(l_l);
        if (env[PTR_EXPCUTOFF] == 0) { expcutoff = EXPCUTOFF; } 
        else { expcutoff = MAX(MIN_EXPCUTOFF, env[PTR_EXPCUTOFF]) + 1; } // +1 to ensure accuracy. See comments in function CINT2e_loop_nopt

        
        int li_ceil = i_l + ng[IINC];
        int lj_ceil = j_l + ng[JINC];
        int lk_ceil = k_l + ng[KINC];
        int ll_ceil = l_l + ng[LINC];

        int nrys_roots = (li_ceil + lj_ceil + lk_ceil + ll_ceil)/2 + 1;


        //printf("[root=%i] %i %i %i %i]", nrys_roots, i_sh, j_sh, k_sh, l_sh);
        //fflush(stdout);
        /*if (nrys_roots == 5){ 
                printf("[root=5 %i %i %i %i]", i_sh, j_sh, k_sh, l_sh);
                fflush(stdout);
        }*/

        int dli, dlj, dlk, dll;
        int ibase = li_ceil > lj_ceil;
        int kbase = lk_ceil > ll_ceil;
        if (nrys_roots <= 2) { // use the fully optimized lj_4d algorithm
                ibase = 0;
                kbase = 0;
        }
        if (kbase) {
                dlk = lk_ceil + ll_ceil + 1;
                dll = ll_ceil + 1;
        } else {
                dlk = lk_ceil + 1;
                dll = lk_ceil + ll_ceil + 1;
        }

        if (ibase) {
                dli = li_ceil + lj_ceil + 1;
                dlj = lj_ceil + 1;
        } else {
                dli = li_ceil + 1;
                dlj = li_ceil + lj_ceil + 1;
        }
        int g_stride_i = nrys_roots;
        int g_stride_k = nrys_roots * dli;
        int g_stride_l = nrys_roots * dli * dlk;
        int g_stride_j = nrys_roots * dli * dlk * dll;
        int g_size     = nrys_roots * dli * dlk * dll * dlj;

        int g2d_klmax; 
        int g2d_ijmax; 

        dtype * rx_in_rklrx; 
        dtype * rx_in_rijrx; 
        dtype rkrl[3];
        dtype rirj[3];

        dtype ai[1];
        dtype aj[1];
        dtype ak[1];
        dtype al[1];
        dtype fac[1];
        dtype rij[3];
        dtype rkl[3];

        if (kbase) {
                g2d_klmax = g_stride_k;
                rx_in_rklrx = rk;
                rkrl[0] = rk[0] - rl[0];
                rkrl[1] = rk[1] - rl[1];
                rkrl[2] = rk[2] - rl[2];
        } else {
                g2d_klmax = g_stride_l;
                rx_in_rklrx = rl;
                rkrl[0] = rl[0] - rk[0];
                rkrl[1] = rl[1] - rk[1];
                rkrl[2] = rl[2] - rk[2];
        }

        if (ibase) {
                g2d_ijmax = g_stride_i;
                rx_in_rijrx = ri;
                rirj[0] = ri[0] - rj[0];
                rirj[1] = ri[1] - rj[1];
                rirj[2] = ri[2] - rj[2];
        } else {
                g2d_ijmax = g_stride_j;
                rx_in_rijrx = rj;
                rirj[0] = rj[0] - ri[0];
                rirj[1] = rj[1] - ri[1];
                rirj[2] = rj[2] - ri[2];
        }

        int i_ctr = _x_ctr[0];
        int j_ctr = _x_ctr[1];
        int k_ctr = _x_ctr[2];
        int l_ctr = _x_ctr[3];


        int *x_ctr  = _x_ctr;
        size_t leng = g_size*3*((1<<gbits)+1);

        int n_comp  = ncomp_e1 * ncomp_e2 * ncomp_tensor;
        size_t nc   = nf * x_ctr[0] * x_ctr[1] * x_ctr[2] * x_ctr[3];

        int counts[4];
        counts[0] = (i_l*2+1) * x_ctr[0];
        counts[1] = (j_l*2+1) * x_ctr[1];
        counts[2] = (k_l*2+1) * x_ctr[2];
        counts[3] = (l_l*2+1) * x_ctr[3];

        if (out == NULL) {
                int i_prim = bas(NPRIM_OF, shls[0]); 
                int j_prim = bas(NPRIM_OF, shls[1]); 
                int k_prim = bas(NPRIM_OF, shls[2]); 
                int l_prim = bas(NPRIM_OF, shls[3]); 
                size_t pdata_size = ((i_prim*j_prim + k_prim*l_prim) * 5 + i_prim * x_ctr[0]  + j_prim * x_ctr[1] + k_prim * x_ctr[2] + l_prim * x_ctr[3] +(i_prim+j_prim+k_prim+l_prim)*2 + nf*3);
                size_t len0       = nf*n_comp;
                size_t cache_size = MAX(leng+len0+nc*n_comp*3 + pdata_size, nc*n_comp+nf*4);
                return cache_size;
        }


        #ifdef __cplusplus
        auto cpu_output = std::vector<float>(nc*n_comp);
        #endif

        int n;
        int empty = 1;

        if (test_CINT2e_loop_nopt){
                #ifdef __cplusplus
                // do compute 
                auto manager    = DeviceManager::createDeviceManager();
                auto devices    = manager.getDevices(poplar::TargetType::IPU, 1);
                auto it         = std::find_if(devices.begin(), devices.end(), [](Device &device) { return device.attach(); });
                if (it == devices.end()) { std::cerr << "Error attaching to device\n"; }
                auto device = std::move(*it);
                auto target = device.getTarget();
                unsigned _n     = 100;
                Graph graph(target);
                graph.addCodelets("CINT2e_loop_nopt.cpp");
                Tensor ipu_input1 = graph.addVariable(FLOAT, {_n}, "ipu_input1");
                Tensor ipu_input2 = graph.addVariable(FLOAT, {35}, "ipu_input2");
                Tensor ipu_output = graph.addVariable(FLOAT, {_n}, "ipu_output");
                graph.setTileMapping(ipu_input1, 0);
                graph.setTileMapping(ipu_input2, 0);
                graph.setTileMapping(ipu_output, 0);
                ComputeSet mulCS = graph.addComputeSet("mulCS");

                auto v = graph.addVertex(mulCS, "poplar_CINT2e_loop_nopt", 
                                        {{"ipu_input1", ipu_input1},  
                                        {"ipu_input2", ipu_input2},
                                        {"ipu_output", ipu_output}}); 

                graph.setTileMapping(v, 0);

                Program mulProg = Execute(mulCS);

                // Set up data streams to copy data in and out of graph
                auto inStreamM = graph.addHostToDeviceFIFO("ipu_input1", FLOAT, _n);
                auto inStreamV = graph.addHostToDeviceFIFO("ipu_input2", FLOAT, 35);
                auto outStream = graph.addDeviceToHostFIFO("ipu_output", FLOAT, _n);

                auto prog = Sequence({Copy(inStreamM, ipu_input1), 
                                Copy(inStreamV, ipu_input2),  
                                mulProg, 
                                Copy(ipu_output, outStream)});

                Engine engine(graph, prog);
                engine.load(device);

                //n_gctr + n_env, 
                #endif


        }
        CINT2e_loop_nopt(gctr, env, rk, ri, rj, rl, expcutoff, rkrl, rirj, 
                         ai, aj, ak, al, fac, rij, rkl, rx_in_rijrx, rx_in_rklrx, 
                         common_factor, (lk_ceil+ll_ceil+1), nc*n_comp, &empty, shls, bas, // ints after this 
                n_env, _x_ctr[0], _x_ctr[1], _x_ctr[2], _x_ctr[3], 
                ncomp_e1 * ncomp_e2 * ncomp_tensor, 
                li_ceil, lj_ceil, lk_ceil, ll_ceil, i_l, 
                j_l, k_l, l_l, nfi, nfj, nfk, nfl, nf, g_stride_i, g_stride_k, 
                g_stride_l, g_stride_j, nrys_roots, ibase, kbase, g_size, g2d_klmax, g2d_ijmax, 
                leng); 


        if (test_CINT2e_loop_nopt){
                // check that CPU output and gctr gives the same! 
                for (int i = 0; i < nc*n_comp; i++){
                        if (std::abs(gctr[i]-cpu_output[i])>1E-6){
                                printf("|gctr[%i]=%f-cpu_output[%i]=%f|=%f>1E-6", i, gctr[i], i, cpu_output[i], std::abs(gctr[i]-cpu_output[i]) );
                                fflush(stdout);
                                abort();
                        }
                }

        }


        if (dims == NULL) { dims = counts; }
        int nout = dims[0] * dims[1] * dims[2] * dims[3];

        if (!empty) {
                for (n = 0; n < n_comp; n++) {
                        // @alex; 
                        // this one is a bit annoying, has a lot of dependencies...
                        // just coped in function for simplicity.. 
                        //c2s_sph_2e1(out+nout*n, gctr+nc*n, dims, &envs, cache);  
                        int di = i_l * 2 + 1;
                        int dj = j_l * 2 + 1;
                        int dk = k_l * 2 + 1;
                        int dl = l_l * 2 + 1;
                        int ni = dims[0];
                        int nj = dims[1];
                        int nk = dims[2];
                        int nl = dims[3];
                        int nfik = nfi * nfk;
                        int nfikl = nfik * nfl;
                        int dlj = dl * dj;
                        int ofj = ni * dj;

                        int ofk = ni * nj * dk;
                        int ofl = ni * nj * nk * dl;
                        int ic, jc, kc, lc;
                        int buflen = nfikl*dj;
                        //printf("[%i %i %i %i buflen=%i]\n", i_sh, j_sh, k_sh, l_sh, buflen);

                        if (print_shapes) {
                                printf("[buflen=%i]", buflen);

                        }


                        dtype buf[3*buflen];
                        dtype * buf1 = buf; 
                        dtype * buf2 = buf+buflen; 
                        dtype * buf3 = buf+buflen*2; 
                        //dtype * buf4 = buf+buflen*3; 

                        //printf("buflen=%i\t", buflen);

                        dtype *pout;
                        dtype *tmp1;
                        dtype *_tmp; 

                        for (lc = 0; lc < l_ctr; lc++) {
                                for (kc = 0; kc < k_ctr; kc++) {
                                        for (jc = 0; jc < j_ctr; jc++) {
                                                for (ic = 0; ic < i_ctr; ic++) {
                                                        // max 2 in our case! 
                                                        tmp1 = c2s_ket_sph[j_l](buf1, gctr, nfikl, nfikl, j_l); 
                                                        //if (j_l > 1) printf("[j_l=%i]", j_l);
                                                        //for (int v = 0; v < buflen; v++) buf1[v] = 0;
                                                        //sph2e_inner(dtype *gsph, dtype *gcart, int l, int nbra, int ncall, int sizsph, int sizcart);
                                                        tmp1 = sph2e_inner(     buf2, tmp1, l_l, nfik, dj,  nfik*dl, nfikl);
                                                        tmp1 = sph2e_inner(     buf3, tmp1, k_l, nfi,  dlj, nfi*dk,  nfik);
                                                        for (int v = 0; v < nc*n_comp; v++) gctr[v] = tmp1[v];
                                                        _tmp = c2s_bra_sph[i_l](buf1, dk*dlj, gctr, i_l); 
                                                        pout = out + ofl * lc + ofk * kc + ofj * jc + di * ic;
                                                        dcopy_iklj(pout, _tmp, ni, nj, nk, nl, di, dj, dk, dl);

                                                        //gctr += nf; // WARNING: 
                                                } 
                                        } 
                                } 
                        }

                }
        } 
        else {
                for (n = 0; n < n_comp; n++) {
                        c2s_dset0(out+nout*n, dims, counts); 
                }
        }

        if (print_shapes) {
                printf("\n");
                fflush(stdout);
        }
        return !empty;
}



