#define LOCATE(v, i, j) \
        int d##i##j = d##i * d##j; \
        _poutptr = out->outptr + shls[i##SH]*out->v_ket_nsh+shls[j##SH] - out->offset0_outptr; \
        if (*_poutptr == NOVALUE) { \
                *_poutptr = out->stack_size; \
                out->stack_size += d##i##j * ncomp; \
                NPdset0(out->data+*_poutptr, d##i##j*ncomp); \
        } \
        ddtype *v = out->data + *_poutptr;
#define DECLARE(v, i, j) \
        int ncomp = out->ncomp; \
        int ncol = out->dm_dims[1]; \
        int di = i1 - i0; \
        int dj = j1 - j0; \
        int dk = k1 - k0; \
        int dl = l1 - l0; \
        int *_poutptr; \
        LOCATE(v, i, j)

#define DEF_NRS1_CONTRACT(D1, D2, V1, V2) \
static void nrs1_##D1##D2##_s1##V1##V2(ddtype *eri, ddtype *dm, JKArray *out, int *shls, \
                         int i0, int i1, int j0, int j1, \
                         int k0, int k1, int l0, int l1) \
{ \
        DECLARE(v, V1, V2); \
        int i, j, k, l, ijkl, icomp; \
        dm += D1##0 * ncol + D2##0 * d##D1; \
 \
        for (ijkl = 0, icomp = 0; icomp < ncomp; icomp++) { \
                for (l = 0; l < dl; l++) { \
                for (k = 0; k < dk; k++) { \
                for (j = 0; j < dj; j++) { \
                for (i = 0; i < di; i++, ijkl++) { \
                        v[V1*d##V2+V2] += eri[ijkl] * dm[D1*d##D2+D2]; \
                } } } } \
                v += d##V1##V2; \
        } \
}

#define DEF_DM(I, J) \
        ddtype *dm##I##J = dm + I##0 * ncol + J##0 * d##I

/* eri in Fortran order; dm, out in C order */

static void nrs1_ji_s1kl(ddtype *eri, ddtype *dm, JKArray *out, int *shls,
                         int i0, int i1, int j0, int j1,
                         int k0, int k1, int l0, int l1)
{
        DECLARE(v, k, l);
        int dij = di * dj;
        DEF_DM(j, i);
        int k, l, ij, icomp;
        ddtype s;

        for (icomp = 0; icomp < ncomp; icomp++) {
                for (l = 0; l < dl; l++) {
                for (k = 0; k < dk; k++) {
                        s = v[k*dl+l];
#pragma GCC ivdep
                        for (ij = 0; ij < dij; ij++) {
                                s += eri[ij] * dmji[ij];
                        }
                        v[k*dl+l] = s;
                        eri += dij;
                } }
                v += dkl;
        }
}
ADD_JKOP(nrs1_ji_s1kl, J, I, K, L, s1);

