static void nrs1_lk_s1ij(ddtype *eri, ddtype *dm, JKArray *out, int *shls,
                         int i0, int i1, int j0, int j1,
                         int k0, int k1, int l0, int l1)
{
        DECLARE(v, i, j);
        DEF_DM(l, k);
        int i, j, k, l, ij, icomp;
        ddtype *buf = eri + dij * dk * dl * ncomp;
        ddtype s;

        for (icomp = 0; icomp < ncomp; icomp++) {

                for (i = 0; i < dij; i++) { buf[i] = 0; }
                for (l = 0; l < dl; l++) {
                for (k = 0; k < dk; k++) {
                        s = dmlk[l*dk+k];
#pragma GCC ivdep
                        for (ij = 0; ij < dij; ij++) {
                                buf[ij] += eri[ij] * s;
                        }
                        eri += dij;
                } }

                for (ij = 0, j = 0; j < dj; j++) {
                for (i = 0; i < di; i++, ij++) {
                        v[i*dj+j] += buf[ij];
                } }
                v += dij;
        }
}
