static void nrs8_ji_s1kl(ddtype *eri, ddtype *dm, JKArray *out, int *shls, int i0, int i1, int j0, int j1, int k0, int k1, int l0, int l1)
{
        fflush(stdout);
        if (i0 == k0 && j0 == l0) {
                nrs4_ji_s1kl  (eri, dm, out, shls, i0, i1, j0, j1, k0, k1, l0, l1);
        } else if (i0 == j0 || k0 == l0) {
                nrs4_ji_s1kl  (eri, dm, out, shls, i0, i1, j0, j1, k0, k1, l0, l1);
                nrs4_lk_s1ij  (eri, dm, out, shls, i0, i1, j0, j1, k0, k1, l0, l1);
        } else {
                DECLARE(vij, i, j);
                LOCATE(vji, j, i);
                LOCATE(vkl, k, l);
                LOCATE(vlk, l, k);
                DEF_DM(i, j);
                DEF_DM(j, i);
                DEF_DM(k, l);
                DEF_DM(l, k);
                int i, j, k, l, ij, icomp;
                ddtype *tdm = eri + dij * dkl * ncomp;
                ddtype *buf = tdm + dij;
                ddtype tdm2, tmp;

                for (icomp = 0; icomp < ncomp; icomp++) {
                        for (ij = 0, j = 0; j < dj; j++) {
                                for (i = 0; i < di; i++, ij++) {
                                        tdm[ij] = dmij[i*dj+j] + dmji[j*di+i];
                                }
                        }
                        for (ij = 0; ij < dij; ij++) {
                                buf[ij] = 0;
                        }

                        for (l = 0; l < dl; l++) {
                        for (k = 0; k < dk; k++) {
                                tmp = 0;
                                tdm2 = dmkl[k*dl+l] + dmlk[l*dk+k];
#pragma GCC ivdep
                                for (ij = 0; ij < dij; ij++) {
                                        tmp += eri[ij] * tdm[ij];
                                        buf[ij] += eri[ij] * tdm2;
                                }
                                vkl[k*dl+l] += tmp;
                                vlk[l*dk+k] += tmp;
                                eri += dij;
                        } }

                        for (ij = 0, j = 0; j < dj; j++) {
                        for (i = 0; i < di; i++, ij++) {
                                vij[i*dj+j] += buf[ij];
                                vji[ij] += buf[ij];
                        } }
                        vij += dij;
                        vji += dji;
                        vkl += dkl;
                        vlk += dlk;
                }
        }
}
ADD_JKOP(nrs8_ji_s1kl, J, I, K, L, s8);

static void nrs8_ji_s2kl(ddtype *eri, ddtype *dm, JKArray *out, int *shls,
                         int i0, int i1, int j0, int j1,
                         int k0, int k1, int l0, int l1)
{
        if (i0 == k0 && j0 == l0) {
                nrs4_ji_s2kl  (eri, dm, out, shls, i0, i1, j0, j1, k0, k1, l0, l1);
        } else if (i0 == j0 || k0 == l0) {
                nrs4_ji_s2kl  (eri, dm, out, shls, i0, i1, j0, j1, k0, k1, l0, l1);
                nrs4_lk_s2ij  (eri, dm, out, shls, i0, i1, j0, j1, k0, k1, l0, l1);
        } else {
                DECLARE(vij, i, j);
                LOCATE(vkl, k, l);
                DEF_DM(i, j);
                DEF_DM(j, i);
                DEF_DM(k, l);
                DEF_DM(l, k);
                int i, j, k, l, ij, icomp;
                ddtype *tdm = eri + dij * dkl * ncomp;
                ddtype *buf = tdm + dij;
                ddtype tmp, tdm2;

                for (icomp = 0; icomp < ncomp; icomp++) {
                        for (ij = 0, j = 0; j < dj; j++) {
                                for (i = 0; i < di; i++, ij++) {
                                        tdm[ij] = dmij[i*dj+j] + dmji[j*di+i];
                                }
                        }
                        for (ij = 0; ij < dij; ij++) {
                                buf[ij] = 0;
                        }

                        for (l = 0; l < dl; l++) {
                        for (k = 0; k < dk; k++) {
                                tdm2 = dmkl[k*dl+l] + dmlk[l*dk+k];
                                tmp = 0;
#pragma GCC ivdep
                                for (ij = 0; ij < dij; ij++) {
                                        buf[ij] += eri[ij] * tdm2;
                                        tmp     += eri[ij] * tdm[ij];
                                }
                                vkl[k*dl+l] += tmp;
                                eri += dij;
                        } }

                        for (ij = 0, i = 0; i < di; i++) {
                        for (j = 0; j < dj; j++, ij++) {
                                vij[ij] += buf[j*di+i];
                        } }
                        vij += dij;
                        vkl += dkl;
                }
        }
}
ADD_JKOP(nrs8_ji_s2kl, J, I, K, L, s8);


