static void nrs8_li_s1kj(ddtype *eri, ddtype *dm, JKArray *out, int *shls,
                         int i0, int i1, int j0, int j1,
                         int k0, int k1, int l0, int l1)
{
        if (i0 == k0 && j0 == l0) {
                nrs4_li_s1kj  (eri, dm, out, shls, i0, i1, j0, j1, k0, k1, l0, l1);
        } else if (i0 == j0 || k0 == l0) { // i0==l0 => i0==k0==l0
                nrs4_li_s1kj  (eri, dm, out, shls, i0, i1, j0, j1, k0, k1, l0, l1);
                nrs4_jk_s1il  (eri, dm, out, shls, i0, i1, j0, j1, k0, k1, l0, l1);
        } else {
                DECLARE(vkj, k, j);
                LOCATE(vki, k, i);
                LOCATE(vlj, l, j);
                LOCATE(vli, l, i);
                LOCATE(vik, i, k);
                LOCATE(vil, i, l);
                LOCATE(vjk, j, k);
                LOCATE(vjl, j, l);
                DEF_DM(l, i);
                DEF_DM(l, j);
                DEF_DM(k, i);
                DEF_DM(k, j);
                DEF_DM(j, l);
                DEF_DM(j, k);
                DEF_DM(i, l);
                DEF_DM(i, k);
                int i, j, k, l, ijkl, icomp;
                ddtype s, s0, s1, s2, s3, tmp0, tmp1, tmp2, tmp3;
                for (ijkl = 0, icomp = 0; icomp < ncomp; icomp++) {
                        for (l = 0; l < dl; l++) {
                        for (k = 0; k < dk; k++) {
                        for (j = 0; j < dj; j++) {
                                s0 = dmlj[l*dj+j];
                                s1 = dmkj[k*dj+j];
                                s2 = dmjl[j*dl+l];
                                s3 = dmjk[j*dk+k];
                                tmp0 = 0;
                                tmp1 = 0;
                                tmp2 = 0;
                                tmp3 = 0;
                                for (i = 0; i < di; i++, ijkl++) {
                                        s = eri[ijkl];
                                        vki[k*di+i] += s * s0;
                                        vli[l*di+i] += s * s1;
                                        vik[i*dk+k] += s * s2;
                                        vil[i*dl+l] += s * s3;
                                        tmp0 += s * dmli[l*di+i];
                                        tmp1 += s * dmki[k*di+i];
                                        tmp2 += s * dmil[i*dl+l];
                                        tmp3 += s * dmik[i*dk+k];
                                }
                                vkj[k*dj+j] += tmp0;
                                vlj[l*dj+j] += tmp1;
                                vjk[j*dk+k] += tmp2; // vkj, vjk may share memory
                                vjl[j*dl+l] += tmp3; // vlj, vjl may share memory
                        } } }
                        vkj += dkj;
                        vki += dki;
                        vlj += dlj;
                        vli += dli;
                        vik += dik;
                        vil += dil;
                        vjk += djk;
                        vjl += djl;
                }
        }
}
ADD_JKOP(nrs8_li_s1kj, L, I, K, J, s8);

