static void nra2ij_lk_s1ij(ddtype *eri, ddtype *dm, JKArray *out, int *shls,
                           int i0, int i1, int j0, int j1,
                           int k0, int k1, int l0, int l1)
{
        if (i0 > j0) {
                DECLARE(vij, i, j);
                LOCATE(vji, j, i);
                DEF_DM(l, k);
                int i, j, k, l, ij, icomp;
                ddtype *buf = eri + dij * dk * dl * ncomp;

                for (icomp = 0; icomp < ncomp; icomp++) {

                        for (i = 0; i < dij; i++) { buf[i] = 0; }
                        for (l = 0; l < dl; l++) {
                        for (k = 0; k < dk; k++) {
#pragma GCC ivdep
                                for (ij = 0; ij < dij; ij++) {
                                        buf[ij] += eri[ij] * dmlk[l*dk+k];
                                }
                                eri += dij;
                        } }

                        for (ij = 0, j = 0; j < dj; j++) {
                        for (i = 0; i < di; i++, ij++) {
                                vij[i*dj+j] += buf[ij];
                                vji[ij] -= buf[ij];
                        } }
                        vij += dij;
                        vji += dij;
                }
        } else {
                nrs1_lk_s1ij  (eri, dm, out, shls, i0, i1, j0, j1, k0, k1, l0, l1);
        }
}
